const initialState = [
  {
    id: 0,
    name: 'Nikhil Mehra',
    number: '987654321',
    email: 'nm@g.com',
  },
  {
    id: 1,
    name: 'Test Number',
    number: '88368229',
    email: 'test@test.com',
  },
];

const userReducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default userReducer;
